import React, {Component} from 'react';

class AuthenticatedComponent extends Component
{
    state={
      user:undefined
    };
    render() {
        return (
            <div>
                <h1>Hello world from auth</h1>
            </div>
        );
    }
}

export default AuthenticatedComponent;
